import{_ as e,o as t,c as i,O as a}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 13.1-1090 Powers and duration of protected series.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/13.1-1090.md","filePath":"vacode/13.1-1090.md"}'),o={name:"vacode/13.1-1090.md"},s=a('<h1 id="§-13-1-1090-powers-and-duration-of-protected-series" tabindex="-1">§ 13.1-1090 Powers and duration of protected series. <a class="header-anchor" href="#§-13-1-1090-powers-and-duration-of-protected-series" aria-label="Permalink to &quot;§ 13.1-1090 Powers and duration of protected series.&quot;">​</a></h1><p>A. A protected series of a series limited liability company has the capacity to sue and be sued in its own name.</p><p>B. Except as otherwise provided in subsections C and D, a protected series of a series limited liability company has the same powers and purpose as the series limited liability company.</p><p>C. A protected series of a series limited liability company ceases to exist not later than when the series limited liability company ceases to exist.</p><p>D. A protected series of a series limited liability company shall not:</p><ol><li><p>Be a member of the series limited liability company;</p></li><li><p>Establish a protected series; or</p></li><li><p>Except as permitted by a law of the Commonwealth other than this article, have any purpose or power that the law of the Commonwealth other than this article prohibits a limited liability company from doing or having.</p></li></ol><p>2019, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0636" target="_blank" rel="noreferrer">636</a>.</p>',7),r=[s];function n(p,l,d,c,h,m){return t(),i("div",null,r)}const y=e(o,[["render",n]]);export{f as __pageData,y as default};
